              <h5 class="md:hidden lg:hidden mb-3">結伴同行的力量</h5>
              <h4 class="sm:hidden md:block lg:block mb-5">結伴同行的力量</h4>
              <p class="caption text-black-6">
                眾志成城，最珍貴的是人與人之間的連結。在真薪話，可以直接和產業前輩進行對話，取得最有價值的建議。每個人都有機會成為那盞照亮別人的燈。
              </p>
