<script setup lang="ts">
import { ref } from 'vue';
import { storeToRefs } from 'pinia';
import { Carousel, Slide } from 'vue3-carousel';
import 'vue3-carousel/dist/carousel.css';
import { showInfo } from '@/utilities/message';
import { useSearchStore } from '@/store/search';
import { useSalaryStore } from '@/store/salary';
import gsap from 'gsap';
import { ScrollTrigger } from 'gsap/ScrollTrigger';
import { ScrollToPlugin } from 'gsap/ScrollToPlugin';

const salaryStore = useSalaryStore();
const { keywords } = storeToRefs(salaryStore);
const searchStore = useSearchStore();
const { latestPosts, popularPosts, popularCompanies, popularCompanyType, userCount, postCount } =
  storeToRefs(searchStore);

// 使用者/薪水數量
const postCountFormat = computed(() => {
  return postCount.value.toLocaleString();
});
const userCountFormat = computed(() => {
  return userCount.value.toLocaleString();
});

/**
 * 搜尋相關
 */
// 搜尋參數
const searchParam = ref({
  keyword: '', // 關鍵字
  company: '', // 公司
  jobTitle: '', // 職位
  companyType: '', // 產業
});
// 點擊關鍵字搜尋
function searchKeyword(keyword: string) {
  const paramObj = !keyword.trim()
    ? undefined
    : {
        searchType: 'keyword',
        param: keyword.trim(),
        page: 1, // 搜尋第一頁
      };
  if (!paramObj) {
    showInfo('提示', '請輸入搜尋條件');
    return;
  }
  search(paramObj);
}
// 點擊產業搜尋
function searchCompanytype(type: string) {
  const paramObj = {
    searchType: 'type',
    param: type,
    page: 1, // 搜尋第一頁
  };
  search(paramObj);
}
// 點擊搜尋
function searchCompany(taxId: string) {
  navigateTo('companies/' + taxId);
}
// 帶著參數導頁至搜尋頁面
async function search(paramObj: { searchType: string; param: string; page: number }) {
  await navigateTo({
    path: '/search',
    query: paramObj,
  });
}

// 薪水檔案櫃
const postCarousel = ref(); // 輪播元件
async function clickPostCard(postId: string) {
  await navigateTo('salary/' + postId);
}
function postsNext() {
  // 下一頁
  postCarousel.value.next();
}
function postsPrev() {
  // 上一頁
  postCarousel.value.prev();
}

// 熱門公司
const comCarousel = ref(); // 輪播元件
function comNext() {
  // 下一頁
  comCarousel.value.next();
}
function comPrev() {
  // 上一頁
  comCarousel.value.prev();
}

function init() {
  // 取得首頁初始化資訊
  searchStore.fetchHomeInit();
  // 取得熱門薪水
  searchStore.fetchTopPost();
  // 取得熱門公司
  searchStore.fetchTopCompany();
  // 取得產業
  searchStore.fetchTopCompanyType();
  // 取得關鍵字
  salaryStore.fetchKeywords();
}

/**
 * 初始化
 */
init();

/**
 * 動畫
 */
gsap.registerPlugin(ScrollTrigger, ScrollToPlugin);
const header = ref();
const home = ref();
let ctx: gsap.Context;
onMounted(() => {
  ctx = gsap.context((self: gsap.Context) => {
    if (self && self.selector) {
      // 解決開頭閃現問題 (FOUC)
      const home = self.selector('.homePage');
      gsap.to(home, { visibility: 'visible', opacity: 1 });

      // 標題動畫
      const titles = self.selector('.title');
      titles.forEach((item: gsap.DOMTarget) => {
        gsap.from(item, {
          y: -100,
          ease: 'expo',
          duration: 1,
          opacity: 0,
          scrollTrigger: {
            trigger: item,
            start: 'top bottom',
            end: 'top 20%',
            // scrub: true,
            // markers: true,
          },
        });
      });

      // 輸入框動畫
      const input = self.selector('.search-input');
      gsap.from(input, {
        y: -100,
        // ease: "expo",
        duration: 1,
        // opacity: 0,
        scrollTrigger: {
          trigger: input,
          start: 'top bottom',
          end: 'top 20%',
          // scrub: true,
          // markers: true,
        },
      });

      // 數字動畫
      gsap.fromTo(
        postCount,
        {
          value: 0,
        },
        {
          duration: 3,
          value: postCount.value,
          onUpdate() {
            postCount.value = postCount.value | 0;
          },
        },
      );
      gsap.fromTo(
        userCount,
        {
          value: 0,
        },
        {
          duration: 3,
          value: userCount.value,
          onUpdate() {
            userCount.value = userCount.value | 0;
          },
        },
      );

      // 顯示前輩/薪水數量動畫
      const countNumber = self.selector('.count-number');
      gsap.from(countNumber, {
        y: -100,
        // ease: "expo",
        duration: 1,
        // opacity: 0,
        scrollTrigger: {
          trigger: countNumber,
          start: 'top bottom',
          end: 'top 20%',
          // scrub: true,
          // markers: true,
        },
      });

      // 資訊區動畫
      const infoBlocks = self.selector('.info-block');
      infoBlocks.forEach((item: gsap.DOMTarget) => {
        gsap.from(item, {
          y: -50,
          ease: 'expo',
          duration: 1,
          opacity: 0,
          scrollTrigger: {
            trigger: item,
            start: 'top 80%',
            end: 'top 20%',
            // scrub: true,
            // markers: true,
          },
        });
      });

      // 薪水檔案櫃動畫
      const postBlocks = self.selector('.post-block');
      postBlocks.forEach((item: gsap.DOMTarget) => {
        gsap.from(item, {
          y: -50,
          ease: 'expo',
          duration: 1,
          opacity: 0,
          scrollTrigger: {
            trigger: item,
            start: 'top 80%',
            end: 'top 20%',
            // scrub: true,
            // markers: true,
          },
        });
      });

      // 熱門產業/熱門公司動畫
      const linkBlocks = self.selector('.link-block');
      linkBlocks.forEach((item: gsap.DOMTarget) => {
        gsap.from(item, {
          y: -50,
          ease: 'expo',
          duration: 1,
          opacity: 0,
          scrollTrigger: {
            trigger: item,
            start: 'top 70%',
            end: 'top 20%',
            // scrub: true,
            // markers: true,
          },
        });
      });

      // 熱門關鍵字動畫
      const keywordBlock = self.selector('.keyword-block');
      gsap.from(keywordBlock, {
        y: -50,
        ease: 'expo',
        duration: 1,
        opacity: 0,
        scrollTrigger: {
          trigger: keywordBlock,
          start: 'top 80%',
          end: 'top 20%',
          // scrub: true,
          // markers: true,
        },
      });

      // banner圖片動畫
      const bannerBlock = self.selector('.banner');
      gsap.from(bannerBlock, {
        y: -100,
        ease: 'expo',
        duration: 1,
        opacity: 0,
        scrollTrigger: {
          trigger: bannerBlock,
          start: 'top 80%',
          end: 'top 20%',
          // scrub: true,
          // markers: true,
        },
      });
      // banner圖片滾動動畫
      const bannerTl = gsap.timeline({
        scrollTrigger: {
          trigger: '.banner',
          start: '30% 30%',
          end: '+=1000',
          scrub: 1,
          // markers: true
        },
      });
      // 人物浮動
      bannerTl.to('#banner-person', { yPercent: -30, duration: 10 });
      // 第一組物件浮動，幅度比較大
      bannerTl.to('#banner-paper-front', { yPercent: -45, duration: 2 }, '<');
      bannerTl.to('#banner-paper-back', { yPercent: -45, duration: 2 }, '<');
      bannerTl.to('#banner-gear', { yPercent: -45, duration: 2 }, '<');
      bannerTl.to('#banner-message', { yPercent: -45, duration: 2 }, '<');
      // 第一組物件浮動，幅度比較小
      bannerTl.to('#banner-pie', { yPercent: -20, duration: 2 }, '<');
      bannerTl.to('#banner-chart', { yPercent: -20, duration: 2 }, '<');
      bannerTl.to('#banner-target', { yPercent: -20, duration: 2 }, '<');
    }
  }, home.value);
});

//   const boxes = self.selector('.banner-person');
//   boxes.forEach((box: gsap.DOMTarget) => {
//     gsap.to(box, {
//       ease: "exop",
//       delay: 2,
//       y: -150,
//       scrollTrigger: {
//         trigger: box,
//         start: '30% 30%',
//         end: '+=1000',
//         scrub: true,
//         markers: true,
//       },
//     });
//   });

onUnmounted(() => {
  ctx.revert();
});
</script>

